import './index.css'

const HealthPrawn=()=>{
    return(
        <div>
            <div>
                <h1>Build Strong Muscles: Lean protein is excellent for muscle growth and repair, and helps with weight management.</h1>
                <img className='girl-image' alt='img' src='https://res.cloudinary.com/dpvrtbqxt/image/upload/v1739630154/DALL_E_2025-02-15_20.03.08_-_An_animated_girl_wearing_a_research_outfit__including_a_white_lab_coat__safety_goggles__and_gloves__carefully_testing_the_health_condition_of_a_small_-removebg_ztasqj.png'/>
            </div>
        </div>
    )
}

export default HealthPrawn
